export default function Sidebar(props) {
  const url = props.url;
  const sidebarList = [
    {
      id: 1,
      title: "Installation",
      url: "#installation",
    },
    {
      id: 2,
      title: "Button Component",
      url: "#buttonComponent",
    },
  ];
  const listItem = sidebarList.map((items) => (
    <li key={items.id}>
      <a href={items.url}>{items.title}</a>
    </li>
  ));
  return (
    <>
      <aside>
        <div className="sidebar">
          <ul>{listItem}</ul>
        </div>
      </aside>
    </>
  );
}
